import React, { Component } from 'react';
import style from './style.css';
export default class App extends Component {


    btnClick(){
        console.log("按钮点击了");

    }


    render() {
        console.log('====================================');
        let doc = document.createElement('div',{name:'class_doc'},'123');
        let react_doc = React.createElement('div')
        var index = 0;
        for (const obj in doc) {
            console.log(obj);
            index++;
        }

        let index1 = 0;
        for (const obj in react_doc) {
            console.log(obj);
            index1++;
        }

        console.log(doc);
        console.log("原生doc的属性数量:",index);
        console.log("React 虚拟doc的属性数量:",index1);

        console.log('====================================');
        let array = [10,20,30,40,50];
        return (
            <div className = 'color'>
                Hellow Word 1234
                <div style={{color:'red'}}>
                我是行内样式 我是原生doc的属性数量:{index}
                </div>
                <div style={{color:'red'}}>
                我是行内样式 我是React 虚拟doc的属性数量:{index1}
                </div>
                <div>
                <ul>
                {
                    array.map((v,key)=>{
                    return <li>{v}</li>
                    })
                }
                </ul>
                </div>
                <button onClick = {this.btnClick}>我是按钮</button>

            </div>

        );
    }
}
